svg.script:


var tl = gsap.timeline(
    {
        repeat: -1,
        repeatDelay: 1,
        onStart: function(){
            gsap.set("#left_upper_arrow", {scaleX:0.2});
            gsap.set("#left_below_arrow", {scaleX:0.1});
            gsap.set("#right_arrow", {scaleX:0.2});
        }
    });

var t2 = gsap.timeline(
    {
        repeat: -1,
        repeatDelay: 1
    });

tl.add(
        gsap.fromTo(
                    "#left_upper_arrow",
                            {
                                scaleX:0.2,
                                delay: 0,
                                duration:1,
                                transformOrigin:"left",

                            },
                            {
                                scaleX:1,
                                delay: 0,
                                duration: 1,
                                ease:Linear.easeNone
                            }
                    )
        );

tl.add(
        gsap.fromTo(
                    "#left_below_arrow",
                            {
                                scaleX:0.1,
                                delay: 1,
                                transformOrigin:"left",
                            },
                            {
                                scaleX:1,
                                delay: 0,
                                duration: 1,
                                ease:Linear.easeNone
                            }
                    )
        );

tl.add(
        gsap.fromTo(
                    "#right_arrow",
                            {
                                scaleX:0.2,
                                delay: 1,
                                transformOrigin:"left",
                            },
                            {
                                scaleX:1,
                                delay: 0,
                                duration: 1,
                                ease:Linear.easeNone
                            }
                    )
        );

tl.add(
        gsap.fromTo(
                    "#right_arrow",
                            {
                                scaleX:1,
                                delay: 0,
                                transformOrigin:"left",
                            },
                            {
                                scaleX:0.2,
                                delay: 3,
                                duration: 1,
                                ease:Linear.easeNone
                            }
                    )
        );

tl.add(
        gsap.fromTo(
                    "#left_below_arrow",
                            {
                                scaleX:1,
                                delay: 0,
                                transformOrigin:"left",                                    
                            },
                            {
                                scaleX:0.1,
                                delay: 0,
                                duration: 1,
                                ease:Linear.easeNone
                            }
                    )
        );

tl.add(
        gsap.fromTo(
                    "#left_upper_arrow",
                            {
                                scaleX:1,
                                delay: 0,
                                duration:1,
                                transformOrigin:"left",

                            },
                            {
                                scaleX:0.2,
                                delay: 0,
                                duration: 1,
                                ease:Linear.easeNone
                            }
                    )
        );

t2.add(
        gsap.to(
                    "#plus_symbol",
                            {
                                rotation:360,
                                delay: 0,
                                duration:4,
                                transformOrigin:"center center",
                                ease:Linear.easeNone    
                            }
                    )
        );

        <!-- plus_symbol -->
